import React from 'react';

export const Momentum = () => {
    return (
        <div>
            <h2>Momentum Loans</h2>
            <ul>
                <li>Customized content to your message.</li>
                <li>Collect data through surveys</li>
            </ul>
        </div>  
    )
}

export const FirstDirectLending = () => {
    return (
        <div>
            <h2>First Direct Lending</h2>
            <ul>
                <li>Open and click-through rates</li>
                <li>Survey responses</li>
                <li>AB Test Results</li>
            </ul>
        </div>  
    )
}

export const NA = () => {
    return (
        <div>
            <h2>North American Mortgage Company</h2>
            <ul>
                <li>15 years of experience</li>
                <li>Engage leads and drive results</li>
            </ul>
        </div>  
    )
}
